import axios from 'axios';

function Sup()
{
  const [path, setPath] = useState('');

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/picture').then(res =>  
    res.json().then(data => setPath(data))
  )},[]);

console.log(path)

  return (
    <header class="App-header">
        <h1>sup</h1>
        <div>
          {path}
          <img src={require({path})} width="500px"></img>
        </div>
    </header>
  );
}


